import React, { useState } from 'react'
import "../Styles/usersignup.css"
export default function UserSignup() {
    let [name,setname]=useState("")
    let [phone,setphone]=useState("")
    let [email,setemail]=useState("")
    let [gender,setgender]=useState("")
    let [age,setage]=useState("")
    let [password,setpassword]=useState("")
  return (
    <div className='usersignup'>
        <form action="">
            <label htmlFor="">NAME</label>
            <input type="text" value={name} onChange={(e)=>{setname(e.target.name)}} />
            <label htmlFor="">PHONE</label>
            <input type="text" value={phone} onChange={(e)=>{setphone(e.target.phone)}} />
            <label htmlFor="">EMAIL</label>
            <input type="text" value={email} onChange={(e)=>{setemail(e.target.email)}} />
            <label htmlFor="">GENDER</label>
            <input type="text" value={gender} onChange={(e)=>{setgender(e.target.gender)}} />
            <label htmlFor="">AGE</label>
            <input type="text" value={age} onChange={(e)=>{setage(e.target.age)}} />
            <label htmlFor="">PASSWORD</label>
            <input type="text" value={password} onChange={(e)=>{setpassword(e.target.password)}} />
            bu
        </form>
    </div>
  )
}
